import React, {Component} from 'react';
import User from "./User";

class Users extends Component {
    render() {
        const {users} = this.props;
        console.log(users);
        return(
            <div>
               {
                   users.map(user => {
                       return(
                           <User 
                                key= {user.id}
                                name = {user.name}
                                department = {user.department}
                                sallery = {user.sallery}

                           />
                          
                       )
                   })
               }

            </div>
        )
    }

}

export default Users;
